import { Menu } from "antd";
import './Menu.css';
import MenuItem from 'antd/es/menu/MenuItem';

export default function MainComponent(props) {     

    return (
        <div className='menu-container'>   
        <Menu
        
        >
            <Menu.Item key="/" title="Inicio">
                        
            </Menu.Item>
        </Menu>
        </div>
    );
  }
